function creaPdf() {
	var doc = new jsPDF("p", "mm", "a4");
	var width = doc.internal.pageSize.getWidth();
	var height = doc.internal.pageSize.getHeight();
	var nome = document.getElementById("nome").value;
	var tel = document.getElementById("telefono").value;
	var email = document.getElementById("email").value;
	var cognome=document.getElementById("cognome").value;
	var data=document.getElementById("datanascita").value;
	var residenza=document.getElementById("residenza").value;
	var indirizzo=document.getElementById("indirizzo").value;
	var numero=document.getElementById("numero").value;
	var luogo=document.getElementById("luogonascita").value;

	var imgData = 
	"data:image/png;base64,"

	doc.addImage(imgData, 'JPEG', 0, 0, width, height); 

	//(x,y,width,height)

//sesso	
var radioSet = document.getElementsByName('sesso');

	var numeroRadio = radioSet.length;
	for( var i = 0; i < numeroRadio; i++ ){
	    if( radioSet[i].checked ){
		var sesso=radioSet[i].value;
		break;
	}
}

//documento
var radioSet = document.getElementsByName('documento');

	var numeroRadio = radioSet.length;
	for( var i = 0; i < numeroRadio; i++ ){
	    if( radioSet[i].checked ){
		var documento=radioSet[i].value;
		break;
	}
}


//data
//var today = new Date();
//var newdat = "PDF generato in data  : "+ today;
//doc.text(30,25,newdat);











	var messaggio = document.getElementById("messaggio").value;

	

	//(x,y)-->  x= colonna numero pi grande sposta a sinistra, riga =y)

	doc.text(40, 66, ' ' + cognome);   //(40,40)
	doc.text(120, 66, ' ' + nome);
	doc.text(40, 95, ' ' + data);
	doc.text(120, 95, ' ' + luogo);
	doc.text(45, 120, ' ' + sesso);
	doc.text(40, 150, '' + residenza);
	doc.text(120, 150, '' + indirizzo);

	

	doc.text(40, 180, '' + tel);
	doc.text(120, 180, ' ' + email);

	
	doc.text(40, 205, ' ' + documento);
	doc.text(120, 205, ' ' + numero);
	
	
	
	doc.text(40, 235, ' ' + messaggio);
	


	

    

	

	//doc.addPage();




	


	// Save the PDF
	doc.save('permesso.pdf');

}







/******CHECK EMAIL **********/


function checkStuff() {
	var email = document.form1.email;
	var msg = document.getElementById('msg');

	if (email.value == "") {
		msg.style.display = 'block';
		msg.innerHTML = "Per favore inserisci l'email";
		email.focus();
		return false;
	} else {
		msg.innerHTML = "";
	}

}
